import { auth } from '../firebase'

export const signup = async (email: string, password: string) => {
    try {
        await auth.createUserWithEmailAndPassword(email, password)
        console.log("user created")
        console.log(email, password)
    } catch (e) {
        console.log(e)
    }
}
